import React, { useState } from 'react';
import { postData } from '../api/endpoint';

const CreateDossier = () => {
  const [formData, setFormData] = useState({
    patientId: '',
    patientName: '',
    motif: '',
    description: ''
  });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
    setError(''); // Clear error on input
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    
    // ‚úÖ Validation frontend
    if (!formData.patientId || !formData.patientName || !formData.motif) {
      setError('‚ùå Patient ID, nom et motif sont obligatoires');
      return;
    }

    try {
      setLoading(true);
      setError('');

      console.log('üì§ Envoi:', formData);
      
      // ‚úÖ Backend re√ßoit TOUS les champs requis
      await postData('/dossiers', formData);
      
      alert('‚úÖ Dossier cr√©√© avec succ√®s !');
      setFormData({ patientId: '', patientName: '', motif: '', description: '' });
    } catch (error) {
      console.error('‚ùå Erreur cr√©ation:', error.message);
      setError(error.message || 'Erreur lors de la cr√©ation du dossier');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={{ padding: '20px', maxWidth: '600px' }}>
      <h2>üìÅ Nouveau dossier m√©dical</h2>

      {error && (
        <div style={{
          backgroundColor: '#fee',
          color: '#c33',
          padding: '12px',
          borderRadius: '6px',
          marginBottom: '20px',
          borderLeft: '4px solid #c33'
        }}>
          {error}
        </div>
      )}

      <form onSubmit={handleSubmit}>
        {/* ‚úÖ CHAMP PATIENT ID - OBLIGATOIRE */}
        <div style={{ marginBottom: '15px' }}>
          <label style={{ display: 'block', marginBottom: '5px', fontWeight: 'bold' }}>
            ID Patient <span style={{ color: 'red' }}>*</span>
          </label>
          <input
            type="text"
            name="patientId"
            placeholder="ex: 64f8b2c3d1e2f3a4b5c6d7e8"
            value={formData.patientId}
            onChange={handleChange}
            required
            style={{
              width: '100%',
              padding: '12px',
              border: '1px solid #ddd',
              borderRadius: '6px',
              fontSize: '16px'
            }}
          />
        </div>

        {/* ‚úÖ CHAMP NOM PATIENT */}
        <div style={{ marginBottom: '15px' }}>
          <label style={{ display: 'block', marginBottom: '5px', fontWeight: 'bold' }}>
            Nom Patient <span style={{ color: 'red' }}>*</span>
          </label>
          <input
            type="text"
            name="patientName"
            placeholder="ex: Jean Dupont"
            value={formData.patientName}
            onChange={handleChange}
            required
            style={{
              width: '100%',
              padding: '12px',
              border: '1px solid #ddd',
              borderRadius: '6px',
              fontSize: '16px'
            }}
          />
        </div>

        {/* MOTIF */}
        <div style={{ marginBottom: '15px' }}>
          <label style={{ display: 'block', marginBottom: '5px', fontWeight: 'bold' }}>
            Motif <span style={{ color: 'red' }}>*</span>
          </label>
          <input
            type="text"
            name="motif"
            placeholder="ex: Consultation annuelle"
            value={formData.motif}
            onChange={handleChange}
            required
            style={{
              width: '100%',
              padding: '12px',
              border: '1px solid #ddd',
              borderRadius: '6px',
              fontSize: '16px'
            }}
          />
        </div>

        {/* DESCRIPTION/DIAGNOSTIC */}
        <div style={{ marginBottom: '20px' }}>
          <label style={{ display: 'block', marginBottom: '5px', fontWeight: 'bold' }}>
            Description / Diagnostic
          </label>
          <textarea
            name="description"
            placeholder="D√©crivez les sympt√¥mes, ant√©c√©dents, diagnostic..."
            value={formData.description}
            onChange={handleChange}
            rows={4}
            style={{
              width: '100%',
              padding: '12px',
              border: '1px solid #ddd',
              borderRadius: '6px',
              fontSize: '16px',
              resize: 'vertical'
            }}
          />
        </div>

        <button 
          type="submit" 
          disabled={loading || !formData.patientId || !formData.patientName || !formData.motif}
          style={{
            width: '100%',
            padding: '14px',
            backgroundColor: loading ? '#ccc' : '#007bff',
            color: 'white',
            border: 'none',
            borderRadius: '6px',
            fontSize: '16px',
            fontWeight: 'bold',
            cursor: loading ? 'not-allowed' : 'pointer'
          }}
        >
          {loading ? '‚è≥ Cr√©ation en cours...' : '‚úÖ Cr√©er le dossier'}
        </button>
      </form>
    </div>
  );
};

export default CreateDossier;
